import React from "react";
import theme from "../styles/theme";

const OtherProject = ({ project }, [description]) => (
  <div className="card">
    <h3>{project}</h3>
    <div className="body">
      <ul className="tech-list">
        {description.map((item) => (
          <li key={item}>{item}</li>
        ))}
      </ul>
    </div>

    <style jsx>
      {`
        .card {
          display: block;
          width: 180px;
          height: 250px;
          padding: 18px;
          border: solid 1px ${theme.colors.gray};
          margin-right: 15px;
          margin-bottom: 15px;
          border-radius: 5px;
          background-color: ${theme.colors.dark};
          color: white;
        }
        .body {
          display: flex;
          height: 100%;
          align-items: flex-end;
          text-align: right;
        }
        tech-list {
          display: inline-block;
        }
        .tech {
          display: inline-block;
          background-color: ${theme.colors.dark};
          box-shadow: 13px 13px rgba(255, 153, 204, 0.3);
          border-radius: 0 10px 0 10px;
          color: white;
          font-weight: 400;
          margin-right: 10px;
          margin-bottom: 10px;
          padding: 8px;
        }
      `}
    </style>
  </div>
);

export default OtherProject;
